column8:
ブランド名／THE OLDE FARMHOUSE(ザ オールドファームハウス)<br>
シリーズ／Sシリーズ<br>
サイズ：W19.0×D14.0×H17.0cm<br>
容積／板厚：1.5L／0.6mm(本体・蓋とも)<br>
生産／中国<br>
※原材料の鉄・釉薬は日本メーカーのものを使用しております。<br>
発売元／タスマンインターナショナル株式会社<br>
<br>
<br>
■材料の種類<br>
本体・蓋／ホーロー用鋼板<br>
こし網・枠／ステンレス鋼<br>
<br>
■表面加工<br>
ホーロー(琺瑯)<br>
<br>
<br>
【使用可能の機器】<br>
<br>
○食洗器<br>
<br>
<br>
【使用不可の機器】<br>
<br>
×電子レンジ<br>
×電磁調理器(IH)<br>
×直火<br>
<br>
<br>
清潔感ある白の本体に黒字のロゴがかわいいしっかりした作りのホーローオイルポットです。<br>
ステンレス製のオイルフィルターが付属されており、取り外して洗えいつも清潔にお使いいただけます。 <br>
<br>
※ホーローの表面はガラス質です。落としたり強い衝撃を与えると割れる場合があります。ご注意下さいませ。<br>
<br>
<br>
【お使いいただく前に】<br>
最初にお使いになるときは、本体・蓋などに不具合がないことをご確認ください。また、必ず柔らかいスポンジに食器用中性洗剤をつけて、ぬるま湯で十分洗って下さい。品質については、十分注意しておりますが、万が一不具合があった場合には、ご使用前にお買い求めの販売店または、販売元までご連絡下さい。<br>
<br>
<br>
【ホーロー製品の特徴】<br>
ホーローは一点一点手作りです。ホーローは鉄生地を液体の釉薬にくぐらせ、ワイヤーで吊るして釜で数回焼いて作っていますので、ワイヤーの吊りあと、釜入れの際の付着物(黒点やシミ)などがございます。また、焼き冷やしを繰り返すことにより、本体に反りやふくらみが出ることもございますが、いずれもホーローの特性ですのでご了承ください。鉄の接合部分、エッジ部分には釉薬が乗らないことがありますが、黒い部分は下地の鉄ですのでご安心ください。<br>
<br>
<br>
【お取扱い上の注意】<br>
●火の側に置かないで下さい。<br>
●油は冷ましてから入れてください。また、油を移すときは転倒しないように注意してください。<br>
●本体底部に沈殿物が溜まったら掃除してください。<br>
●スチールたわし、磨き粉やクレンザーはホーローの表面を傷つけます。ご使用後は柔らかいスポンジに食器用洗剤をつけよく洗い、水分を拭き取って自然乾燥させて下さい。<br>
●ぶつけたり、高いところから落下させるなど、強い衝撃を与えないで下さい。ホーローの表面はガラス質なのでひび割れするなど破損の恐れがあります。<br>
●塩分や酸などを含んだ汚れを付着したまま放置したり、湿気の多い場所での保管はサビの発生の原因となります。もし腐食が発生した場合は、できるだけ早めにスポンジなどで洗い落としてから水分を拭き取り、よく乾燥させて下さい。<br>
●電子レンジ、オーブンレンジなどでは絶対に使用しないで下さい。蓋の破損、器具の故障や火災の原因になります。<br>
<br>

<br><hr><br>

区分：バラエティ<br><br>
タスマンインターナショナル　エトワール<br><br>


